import { useSelector } from "react-redux";
import Card from "./Card";

const Favorites = () => {

  const favorites = useSelector(state => state.myFavorites);
  const { onClose } = props;

  return (
    <>
    {favorites.map( (fav) => {
      return (     
      <Card 
      id={fav.id} 
      name={fav.name}
      status={fav.status}
      species={fav.species}
      gender={fav.gender}
      origin={fav.origin.name}
      image={fav.image}
      onClose={onClose}
      />
      )
    })}
    </>
  )


}

export default Favorites;
